cv::Mat ReadImage(const wchar_t* filename)
{
    FILE* fp = _wfopen(filename, L"rb");
    if (!fp)
    {
        return Mat::zeros(1, 1, CV_8U);
    }
    fseek(fp, 0, SEEK_END);
    long sz = ftell(fp);
    char* buf = new char[sz];
    fseek(fp, 0, SEEK_SET);
    long n = fread(buf, 1, sz, fp);
    _InputArray arr(buf, sz);
    Mat input_img = imdecode(cv::Mat(1, sz, CV_8UC1, buf), cv::IMREAD_UNCHANGED);
    //imshow("Display Image", input_img);
    delete[] buf;
    fclose(fp);
    return input_img;
}

